import React from "react";
import "./Left.css";

export default function Left() {
  return (
    <div className = "sidebar">
        <ul className = "nav-links">
            <a href = "#">
            <img className= "icon" src="../assets/img/dashboard.svg"  id = "icon"  alt="" />
            <span className= "link_name">Dashboard</span>
            </a>
        </ul>
    </div>
  );
}
